import React from "react";
import styled from "styled-components";
import Theme from "../components/themes/defaultTheme";

import { Header } from "../components/Header";
import Calendar from "../modules/calandar/Calendar";

const Wrapper = styled.div`
  width: 100%;
  color: ${(props) => props.theme.colors.black};
`;
const PageTitle = styled.h1`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
`;
const events = [
  { id: "1", title: "Concert", date: "2023-04-22" },
  { id: "2", title: "Art exhibition", date: "2023-01-28" },
  { id: "3", title: "Theater play", date: "2023-05-05" },
];
export const CalendarScreen = () => {
  return (
    <Theme>
      <Wrapper>
        <Header />
        <PageTitle>Agenda</PageTitle>
        <Calendar events={events} />
      </Wrapper>
    </Theme>
  );
};

export default CalendarScreen;
